import {connect} from 'react-redux'
import Post from '../components/Post'


function mapStateToProps(state, ownProps) {
    return {
        title: ownProps.title,
        text: ownProps.text,
        id: ownProps.id,
        state: state.form
    }
}


export default connect(
    mapStateToProps,
)(Post)
